import React from "react";
import styled from "styled-components";

const Section = styled.section`
  min-height: 100vh;
  width: 100vw;
  background-color: ${(props) => props.theme.text};
  position: relative;
`;

const Showcase = () => {
  return <Section>Showcase</Section>;
};

export default Showcase;
